//显示或隐藏
function GetShowOrHide(id,type){
    if(type=='show')
        $(id).show();
    else if(type=='hide')
        $(id).hide();
}
//获取随机码
function createHexRandom(){
    var num = '';
    for (i = 0; i <= 31; i++)
    {
        var tmp = Math.ceil(Math.random()*15);
        if(tmp > 9){
            switch(tmp){
                case(10):
                    num+='a';
                    break;
                case(11):
                    num+='b';
                    break;
                case(12):
                    num+='c';
                    break;
                case(13):
                    num+='d';
                    break;
                case(14):
                    num+='e';
                    break;
                case(15):
                    num+='f';
                    break;
            }
        }else{
            num+=tmp;
        }
    }
    return num;
}
